import { ProductItem } from "./ProductItem";

export function CartItem({ date, onCountUp, onCountDown, onDelete }) {
  return (
    <div className="col-md-6">
      <h1>Cart Items</h1>
      <div className="row">
        <div classame="col-md-6">
          <div className="row">
 
            {/* <p>{date.title}</p>
            <p>Count: {date.count}</p> */}
            {/* Add other cart item details here */}
            <button onClick={() => onCountUp(date)}>Increase Count</button>
            <button onClick={() => onCountDown(date)}>Decrease Count</button>
            <button onClick={() => onDelete(date)}>Remove</button>
          </div>
        </div>
      </div>
    </div>
  );
}
